  const [isZoomed5, setIsZoomed5] = useState(false);

  const handleMouseEnter1 = () => {
    setIsZoomed1(true);
  };

  const handleMouseLeave1 = () => {
    setIsZoomed1(false);
  };


  const handleMouseEnter = () => {
    setIsZoomed(true);
  };

  const handleMouseLeave = () => {
    setIsZoomed(false);
  };

  const imageStyle = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed ? 'scale(1.3)' : 'scale(1)',
  };
  const imageStyle1 = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed1 ? 'scale(1.3)' : 'scale(1)',
  };

  const handleMouseEnter2 = () => {
    setIsZoomed2(true);
  };

  const handleMouseLeave2 = () => {
    setIsZoomed2(false);
  };

  const imageStyle2 = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed2 ? 'scale(1.3)' : 'scale(1)',
  };
  const handleMouseEnter3 = () => {
    setIsZoomed3(true);
  };

  const handleMouseLeave3 = () => {
    setIsZoomed3(false);
  };

  const imageStyle3 = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed3 ? 'scale(1.3)' : 'scale(1)',
  };
  const handleMouseEnter4 = () => {
    setIsZoomed4(true);
  };

  const handleMouseLeave4 = () => {
    setIsZoomed4(false);
  };

  const imageStyle4 = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed4 ? 'scale(1.3)' : 'scale(1)',
  };
  const handleMouseEnter5 = () => {
    setIsZoomed5(true);
  };

  const handleMouseLeave5 = () => {
    setIsZoomed5(false);
  };

  const imageStyle5 = {
    maxWidth: '100%',
    borderRadius: '100%',
    transition: 'transform 0.3s ease',
    transform: isZoomed5 ? 'scale(1.3)' : 'scale(1)',
  };

  return (
    <MKBox component="section" py={{ xs: 0, sm: 12 }}>
     <MKBox
        width="100%"
        sx={{
          backgroundImage: `url(${bgImage})`,
          backgroundSize: "cover",
          backgroundPosition: "top",
          backgroundAttachment: "fixed", // Fondo est√°tico
          placeItems: "center"
        }}
      >
     <MKBox
        variant="gradient"
        opacity={0.8}
        bgColor="info"
        position="relative"
        borderRadius="xl"
